"use strict";(self.webpackChunkmickael_blog=self.webpackChunkmickael_blog||[]).push([[477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/architecture-rentcrl","metadata":{"permalink":"/blog/architecture-rentcrl","source":"@site/blog/architecture-rentcrl.md","title":"Architecture de RentCRL","description":"1 - Introduction","date":"2024-03-07T00:00:00.000Z","formattedDate":"7 mars 2024","tags":[],"readingTime":1.475,"hasTruncateMarker":false,"authors":[{"name":"Micka\xebl C\xe9raline"}],"frontMatter":{"title":"Architecture de RentCRL","author":"Micka\xebl C\xe9raline","date":"2024-03-07T00:00:00.000Z"},"nextItem":{"title":"Pr\xe9sentation de RentCRL","permalink":"/blog/presentation-rentcrl"}},"content":"\x3c!-- # 02 - Architecture de RentCRL --\x3e\\r\\n\\r\\n## 1 - Introduction\\r\\n\\r\\nDans cet article, je vais vous pr\xe9senter l\'architecture de RentCRL, visant \xe0 simplifier la gestion locative en automatisant les t\xe2ches telles que la collecte des loyers et la g\xe9n\xe9ration des quittances pour les propri\xe9taires.\\r\\n\\r\\n## 2 - Choix Conceptuels\\r\\n\\r\\nPour ce projet de taille modeste, j\'ai choisi de r\xe9aliser uniquement 3 diagrammes dans ma partie conception pour m\'aider \xe0 le concr\xe9tiser.\\r\\n\\r\\nLes voici :\\r\\n\\r\\n### Diagramme de cas d\'utilisation\\r\\n\\r\\n<a href=\\"/img/architecture-Use-case.jpg\\" target=\\"_blank\\">\\r\\n<img src=\\"/img/architecture-Use-case.jpg\\" alt=\\"architecture-Use-case\\"/>\\r\\n</a>\\r\\nLe diagramme de cas d\'utilisation de RentCRL illustre les interactions entre les utilisateurs et le syst\xe8me. Les acteurs, tels que les propri\xe9taires, les locataires et les collaborateurs, interagissent avec diff\xe9rentes fonctionnalit\xe9s de l\'application.\\r\\n\\r\\n### Diagramme de classe\\r\\n\\r\\n<a href=\\"/img/architecture-Class-Diagram.jpg\\" target=\\"_blank\\">\\r\\n<img src=\\"/img/architecture-Class-Diagram.jpg\\" alt=\\"architecture-Class-Diagram\\"/>\\r\\n</a>\\r\\nLe diagramme de classe de RentCRL mod\xe9lise la structure des entit\xe9s principales et leurs relations.\\r\\n\\r\\n### Diagramme d\'infrastructure\\r\\n\\r\\n<a href=\\"/img/architecture-Infrastructure.jpg\\" target=\\"_blank\\">\\r\\n<img src=\\"/img/architecture-Infrastructure.jpg\\" alt=\\"architecture-Infrastructure\\"/>\\r\\n</a>\\r\\n\\r\\nL\'infrastructure de RentCRL se compose de quatre \xe9l\xe9ments cl\xe9s :\\r\\n\\r\\n- Web : L\'application web contenant les fichiers JavaScript, HTML, CSS.\\r\\n- Backend : L\'application backend renfermant les fichiers C# / .Net et responsable du fonctionnement logique du syst\xe8me.\\r\\n- DataBase \'CosmosDB\' : Le stockage s\xe9curis\xe9 des donn\xe9es n\xe9cessaires au bon fonctionnement de RentCRL.\\r\\n- Auth0 : L\'authentification et la gestion des mots de passe des utilisateurs.\\r\\n\\r\\nJ\'ai choisi ces trois diagrammes sp\xe9cifiques pour leur pertinence m\xeame dans le cadre d\'un projet modeste comme RentCRL. Ensemble, ils fournissent une perspective exhaustive des interactions utilisateur, de la structure des donn\xe9es et de l\'infrastructure technique n\xe9cessaires pour le d\xe9veloppement du syst\xe8me.\\r\\n\\r\\n## 3 - CONCLUSION\\r\\n\\r\\nCes diagrammes constituent une base solide pour commencer la r\xe9alisation concr\xe8te de RentCRL. Dans le prochain article, je commencerai \xe0 montrer comment cr\xe9er la solution."},{"id":"/presentation-rentcrl","metadata":{"permalink":"/blog/presentation-rentcrl","source":"@site/blog/presentation-rentcrl.md","title":"Pr\xe9sentation de RentCRL","description":"1 - Objectif","date":"2023-09-30T00:00:00.000Z","formattedDate":"30 septembre 2023","tags":[],"readingTime":1.225,"hasTruncateMarker":false,"authors":[{"name":"Micka\xebl C\xe9raline"}],"frontMatter":{"title":"Pr\xe9sentation de RentCRL","author":"Micka\xebl C\xe9raline","date":"2023-09-30T00:00:00.000Z"},"prevItem":{"title":"Architecture de RentCRL","permalink":"/blog/architecture-rentcrl"}},"content":"\x3c!-- # 01 - Pr\xe9sentation de RentCRL --\x3e\\r\\n\\r\\n## 1 - Objectif\\r\\n\\r\\n<head>\\r\\n  <meta name=\\"og:title\\" content=\\"Pr\xe9sentation RentCRL\\"/>\\r\\n  <meta name=\\"og:image\\" content=\\"/static/img/logo_RentCRL.png\\"/>\\r\\n  <meta name=\\"twitter:image\\" content=\\"/static/img/logo_RentCRL.png\\"/>\\r\\n</head>\\r\\n\\r\\nJe suis heureux de vous pr\xe9senter mon nouveau projet, RentCRL. Dans les prochains jours, je travaillerai activement sur ce projet et partagerai avec vous les d\xe9tails de son d\xe9veloppement \xe0 travers une s\xe9rie d\'articles.\\r\\n\\r\\nRentCRL vise \xe0 simplifier la gestion des biens immobiliers pour les propri\xe9taires. Il s\'agit d\'une application web qui permettra aux propri\xe9taires de pr\xe9lever les loyers de leurs locataires et d\'envoyer les quittances de mani\xe8re enti\xe8rement automatis\xe9e.\\r\\n\\r\\n## 2 - Inspiration\\r\\n\\r\\nL\'id\xe9e derri\xe8re RentCRL d\xe9coule d\'une exp\xe9rience personnelle au sein de notre entreprise familiale sp\xe9cialis\xe9e dans l\'immobilier. Nous avons constat\xe9 la n\xe9cessit\xe9 de simplifier le processus de gestion des loyers et des quittances, actuellement g\xe9r\xe9 manuellement avec l\'aide de l\'outil Rentila.\\r\\n\\r\\nMes motivations pour ce projet sont doubles :\\r\\n\\r\\n<ol>\\r\\n  <li>Simplifier et automatiser une t\xe2che fastidieuse tout en mettant en pratique mes comp\xe9tences en d\xe9veloppement web.</li>\\r\\n  <li>Accro\xeetre ma visibilit\xe9 en tant que d\xe9veloppeur web pour d\xe9crocher des contrats de d\xe9veloppement int\xe9ressants.</li>\\r\\n</ol>\\r\\n\\r\\n## 3 - M\xe9thodologie\\r\\n\\r\\nLe d\xe9veloppement de RentCRL fera appel aux technologies suivantes :\\r\\n\\r\\n<ul>\\r\\n  <li>Front-end :\\r\\n    <ul>\\r\\n      <li>JavaScript</li>\\r\\n      <li>HTML5</li>\\r\\n      <li>Angular</li>\\r\\n      <li>CSS3</li>\\r\\n    </ul>\\r\\n  </li>\\r\\n  <li>Back-end :\\r\\n    <ul>\\r\\n      <li>C# / .NET</li>\\r\\n    </ul>\\r\\n  </li>\\r\\n  <li>Base de donn\xe9es :\\r\\n    <ul>\\r\\n      <li>Azure CosmosDB</li>\\r\\n    </ul>\\r\\n  </li>\\r\\n</ul>\\r\\n\\r\\n## 4 - \xc0 venir\\r\\n\\r\\nJe commencerai par la phase de planification et de conception. Prochainement, je vous pr\xe9senterai en d\xe9tail l\'architecture de RentCRL."}]}')}}]);